import React from 'react';
import AuthContext from "../context/AuthContext";

const Home = () => {
    const navigate = useNavigate();
    const { user } = useContext(AuthContext);
    useEffect(() => {
      !user && navigate("/login", { replace: true });
    }, []);
    return <h1>This is Home Page</h1>;
  };
  
  export default Home;
